class Dado {

    id;
    numero;

    jogarDado() {
        this.numero = Math.round((Math.random() * 6));
        return this.numero;
    }

    setId(id) {
        this.id = id;
    }
    getId() {
        return this.id;
    }

    getNumero() {
        return this.numero;
    }
}

export default Dado;
